import axios from 'axios';
import React, { Component } from 'react';
import WineBar from './WineBar';
import '../../styles/WineBars.css';
class WineBars extends Component {
    constructor(props){
        super();
        this.state = {
            data: [],
            zipCode: '94109'
        }
    }
    componentDidMount(){
        axios.get("/winebars", {params: { zipCode: this.state.zipCode} })
        .then((response) => {
            this.setState({data: response.data})
            if(this.state.data.hasOwnProperty("businesses")){
                console.log(this.state.data.businesses);

            Object.entries(this.state.data.businesses).map(([key, value], i) => {
                console.log(value);
                console.log(value.name);
                console.log(value.display_phone);
                console.log(value.location.display_address.join("\n"));
            })
        }

        })
        .catch((error) => {
            console.log(error);
        })
    }

    render() {
        return (
            <div className="wineBarsContainer">
                <h4 className="eventHeader">Wine Bars</h4>
                {this.state.data.hasOwnProperty("businesses") &&

                 Object.entries(this.state.data.businesses).map(([key, value], i) => {
                     return (
                         <WineBar 
                            key={value.id}
                            name={value.name} 
                            display_name={value.display_phone}
                            display_address={value.location.display_address.join("\n")}
                            url={value.url}
                         />
                     )
                })

                }
            </div>
        );
    }
}

export default WineBars;
